window.bookSummaryJSON = "<p><b>The sky falls dark...the endgame is here.</b>&nbsp;</p> <p><i>Under siege</i>&nbsp;</p> <p>As the relentless approach of a truly gargantuan mothership sparks chaos on Earth, many believe the end times are here. The unknown beings are more technologically advanced than humanity can even comprehend, let alone match. Worst of all, observation makes one thing clear: They aren't coming to chat.&nbsp;</p> <p><i>United in fear</i>&nbsp;</p> <p>For the first time since Dan McCarthy's initial contact with aliens a full 16 years earlier, the whole world is united against an existential threat. Humanity has its back against the wall like never before, side by side with two friendly races against odds that hardly bear thinking about.&nbsp;</p> <p><i>Defiant until the end</i>&nbsp;</p> <p>But while billions understandably cower in fear, a few stand defiant. The gauntlet is thrown down. A showdown is coming. And be it on Earth or in space, the McCarthys will be there....</p> <p><b>Don't miss </b><b><i>Not Alone: Endgame</i></b><b>, the epic culmination of the groundbreaking saga!</b>&nbsp;</p> <p><b>Note for listeners: Stay tuned for the brand new Not Alone: Origins story collection.</b></p>"; 
